def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    priorities = np.zeros(len(bins))

    for i, bin_capacity in enumerate(bins):
        if item == bin_capacity:
            priorities[i] = 1.0
        elif item < bin_capacity:
            priorities[i] = item / bin_capacity
        else:
            remaining_capacity = bin_capacity
            used_capacity = 0
            for j in range(i):
                used_capacity += bins[j]
            remaining_capacity -= used_capacity
            if item <= remaining_capacity:
                priorities[i] = 1.0
            else:
                available_bins = []
                for k, capacity in enumerate(bins):
                    if capacity >= item:
                        available_bins.append(k)
                if available_bins:
                    priorities[available_bins[0]] = 1.0
                    for idx in range(1, len(available_bins)):
                        priorities[available_bins[idx]] = (item - bins[available_bins[idx-1]]) / (bins[available_bins[idx]] - bins[available_bins[idx-1]])
                else:
                    max_capacity = max(bins)
                    max_index = np.argmax(bins)
                    priorities[max_index] = 1 - ((item - remaining_capacity) / (max_capacity - remaining_capacity))

    return priorities
